import react from 'react';
import {NavLink} from 'react-router-dom'

const MyData = ()=>{
    return (
        <>
        <div className="row">
           
        <h1 className="col-12 col-md-4 text-center">Search your user name</h1><NavLink activeClassName="" to="myData"><span className="float-right">visit user</span></NavLink>
        </div>
    </> 
   )
}

export default MyData
